import db from '../../repository';

const getQuiz = async (id) => {
  const quiz = await db().collection('quiz').doc(id).get();
  if (quiz.exists) {
    console.log('EXISSTS!!!');
    return quiz.data();
  }
  console.log('DOESNT EXISTS');
  return {};
};

export default { getQuiz };
